import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    Container,
    IconButton,
    Box,
    ImageList,
    ImageListItemBar,
    ImageListItem,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
    Card,
    Divider,
    CardMedia,
  } from "@mui/material";

  import image from './images/image5.png'

  const MazeGameCard = (
    <Card
      sx={{ bgcolor: "cyan" 
    }} 
    >
    <Typography sx={{ fontSize: 20}} color="text.primary" gutterBottom>
      Maze Game
    </Typography>
    <Divider />
    <CardMedia
      component="img" // Set the component to "img" for images
      alt="Project Image"
      height="200" // Set the desired height for your image
      src={image} // Provide the image URL or path
      style={{
        objectFit: "cover",
        width: "100%",
        height: "100%",
      }}
    />
  </Card>
);

const DevOpsCard = (
    <Card
      sx={{ bgcolor: "cyan" 
    }} 
    >
    <Typography sx={{ fontSize: 20}} color="text.primary" gutterBottom>
      Dev Ops
    </Typography>
    <Divider />
    <CardMedia
      component="img" // Set the component to "img" for images
      alt="Project Image"
      height="200" // Set the desired height for your image
      src={image} // Provide the image URL or path
      style={{
        objectFit: "cover",
        width: "100%",
        height: "100%",
      }}
    />
  </Card>
);
  function Projects() {
    return (
    <Container
      fixed
      sx={{
        bgcolor: "transparent",
        marginTop: '10vh', 
        marginBottom: '10vh',
      }}
    >
        <Box sx={{ pt: "10px" }}>
            <h1>Projects</h1>
            <Stack spacing={2} sx={{ mb: "10px", borderBottom: "2px solid white" }}>
                <Box sx={{ flex: 1, textAlign: 'center' }}> 
                    {MazeGameCard}
                </Box>
                <Box sx={{ flex: 1, textAlign: 'center' }}>
                    {DevOpsCard}
                </Box>
            </Stack>
        </Box>
    </Container>
    );
  };

  export default Projects;
